. For signaling between cells, signal transduction is restricted to events at and within the receiving cell.\")\n	(instanceOf [GK_139809])\n	(name \"signal transduction\")\n	(referenceDatabase [GK_1]))\n\n([GK_141075] of  Person\n\n	(_displayName \"Ashkenazi, A\")\n	(DB_ID 141075)\n	(initial \"A\")\n	(surname \"Ashkenazi\"))\n\n([GK_141083] of  Summation\n\n	(_displayName \"Tumor necrosis factor-related apoptosis-inducing ligand or A...\")\n	(DB_ID 141083)\n	(literatureReference\n		[GK_140992]\n		[GK_3371373]\n		[GK_141314])\n	(text \"Tumor necrosis factor-related apoptosis-inducing ligand or Apo 2 ligand (TRAIL/Apo2L) is a member of the tumor necrosis factor (TNF) family. This group of apoptosis induction pathways all work through protein interactions mediated by the intracellular death domain (DD), encoded within the cytoplasmic domain of the receptor. TRAIL selectively induces apoptosis through its interaction with the Fas-associated death domain protein (FADD) and caspase-8/10 (Wang S & el-Deiry WS 2003; Sprick MR et al. 2002). TRAIL and its receptors, TRAIL-R1 and TRAIL-R2, were shown to be rapidly endocytosed via clathrin-dependent and -independent manner in human Burkitt\'s lymphoma B cells (BJAB) (Kohlhaas SL et al. 2007). However, FADD and caspase-8 were able to bind TRAIL-R1/R2 in TRAIL-stimulated BJAB cells at 4<sup>o</sup>C (at which membrane trafficking is inhibited), suggesting that the endocytosis was not required for an assembly of the functional TRAIL DISC complex. Moreover, blocking of clathrin-dependent endocytosis did not interfere with the capacity of TRAIL to promote apoptosis (Kohlhaas SL et al. 2007).<br>\"))\n\n([GK_141084] of  InstanceEdit\n\n	(_displayName \"Gillespie, ME, 2004-08-31 03:31:31\")\n	(author [GK_73681])\n	(dateTime \"2004-08-31 03:31:31\")\n	(DB_ID 141084))\n\n([GK_141118] of  Complex\n\n	(_displayName \"[Hsa] TRAIL receptor-2:TRAIL complex [plasma membrane]\")\n	(DB_ID 141118)\n	(hasComponent\n		[GK_65505]\n		[GK_66186])\n	(