IKBKB; however, reports are controversial. Involved in IL-18 signaling and is proposed to function as a sorting adaptor for MYD88 in IL-18 signaling during adaptive immune response.FUNCTION Isoform 2: Proposed to inhibit LPS-TLR4 signaling at the late endosome by interaction with isoform 1 thereby disrupting the association of isoform 1 with TICAM1. May be involved in TLR4 degradation in late endosomes.\")\n	(DB_ID 165789)\n	(description \"recommendedName: TIR domain-containing adapter molecule 2 shortName:TICAM-2  alternativeName: Putative NF-kappa-B-activating protein 502  alternativeName: TRIF-related adapter molecule  alternativeName: Toll-like receptor adaptor protein 3  alternativeName: Toll/interleukin-1 receptor domain-containing protein shortName:MyD88-4 \")\n	(geneName\n		\"TICAM2\"\n		\"TIRAP3\"\n		\"TIRP\"\n		\"TRAM\")\n	(identifier \"Q86XR7\")\n	(isSequenceChanged FALSE)\n	(keyword\n		\"3D-structure\"\n		\"Alternative splicing\"\n		\"Cell membrane\"\n		\"Complete proteome\"\n		\"Cytoplasm\"\n		\"Endoplasmic reticulum\"\n		\"Endosome\"\n		\"Golgi apparatus\"\n		\"Immunity\"\n		\"Inflammatory response\"\n		\"Innate immunity\"\n		\"Lipoprotein\"\n		\"Membrane\"\n		\"Myristate\"\n		\"Phosphoprotein\"\n		\"Reference proteome\")\n	(name \"TICAM2\")\n	(referenceDatabase [GK_2])\n	(secondaryIdentifier\n		\"TCAM2_HUMAN\"\n		\"B3Y698\"\n		\"Q6JUT2\")\n	(sequenceLength 235)\n	(species [GK_48887]))\n\n([GK_165792] of  ReferenceGeneProduct\n\n	(_chainChangeLog \"chain:1-712 added on Sat February 7 2015\")\n	(_displayName \"[Hsa] UniProt:Q8IUC6 TICAM1 recommendedName: TIR domain-containing adapter molecule 1 shortName:TICAM-1  alternativeName: Proline-rich, vinculin and TIR domain-containing protein B  alternativeName: Putative NF-kappa-B-activating protein 502H  alternativeName: Toll-interleukin-1 receptor domain-containing adapter protein inducing interferon beta shortName:MyD88-3 shortName:TIR domain-containing adapter protein inducing IFN-beta \")\n	(chain \"chai