and apoptosis in cellular systems [Boatright KM and Salvesen GS 2003; Keller N et al 2010; Oberst A et al 2010].<p>The caspase-8 zymogens are present in the cells as inactive monomers, which are recruited to the death-inducing signaling complex (DISC) by homophilic interactions with the DED domain of FADD. The monomeric zymogens undergo dimerization and the subsequent conformational changes at the receptor complex, which results in the formation of catalytically active form of procaspase-8.[Boatright KM et al 2003; Donepudi M et al 2003; Keller N et al 2010; Oberst A et al 2010].\"))\n\n([GK_213104] of  Summation\n\n	(_displayName \"Procaspase-8 monomers undergo dimerization. The dimerization...\")\n	(DB_ID 213104)\n	(text \"Procaspase-8 monomers undergo dimerization. The dimerization event occurs at death-inducing signaling complex (DISC) and results in a reposition of the procaspase-8 inter-subunit linker to become accessible for intermolecular processing by the associated procaspase-8 molecule [Keller N et al 2010; Oberst A et al 2010].\"))\n\n([GK_2132740] of  GO_BiologicalProcess\n\n	(_displayName \"signal transduction in absence of ligand\")\n	(accession \"0038034\")\n	(DB_ID 2132740)\n	(definition \"A series of molecular signals initiated by the absence of a ligand or the withdrawal of a ligand from a receptor.\")\n	(instanceOf [GK_141])\n	(name \"signal transduction in absence of ligand\")\n	(referenceDatabase [GK_1]))\n\n([GK_2133460] of  GO_MolecularFunction\n\n	(_displayName \"cysteine-type endopeptidase activity involved in apoptotic process\")\n	(accession \"0097153\")\n	(componentOf [GK_2273])\n	(DB_ID 2133460)\n	(definition \"Catalysis of the hydrolysis of internal, alpha-peptide bonds in a polypeptide chain by a mechanism in which the sulfhydryl group of a cysteine residue at the active center acts as a nucleophile, and contributing to the apoptotic process.\")\n	(instanceOf [GK_4344])\n	(name \"cysteine-type endopeptidase activity involved in apoptotic process\")\n	(referenceDatabase [GK_1]))\n\n([GK_2133497] of  GO_BiologicalProcess\n\n	(_displayName \"apoptotic signaling pathway\")\n	(accession \"0097190\")\n	(componentOf [GK_2273])\n	(DB_ID 2133497)\n	(definition \"A series of molecular signals which triggers the apoptotic death of a cell. The pathway starts with reception of a signal, and ends when the execution phase of apoptosis is triggered.\")\n	(instanceOf [GK_141])\n	(name \"apoptotic signaling pathway\")\n	(referenceDatabase [GK_1])\n	(regulate [GK_2133501]))\n\n([GK_2133498] of  GO_BiologicalProcess\n\n	(_displayName \"extrinsic apoptotic signaling pathway\")\n	(accession \"0097191\")\n	(DB_ID 2133498)\n	(definition \"A series of molecular signals in which a signal is conveyed from the cell surface to trigger the apoptotic death of a cell. The pathway starts with either a ligand binding to a cell surface receptor, or a ligand being withdrawn from a cell surface receptor (e.g. in the case of signaling by dependence receptors), and ends when the execution phase of apoptosis is triggered.\")\n	(instanceOf\n		[GK_140]\n		[GK_2133497])\n	(name \"extrinsic apoptotic signaling pathway\")\n	(referenceDatabase [GK_1]))\n\n([GK_2133499] of  GO_BiologicalProcess\n\n	(_displayName \"extrinsic apoptotic signaling pathway in absence of ligand\")\n	(accession \"0097192\")\n	(DB_ID 2133499)\n	(definition \"A series of molecular signals in which a signal is conveyed from the cell surface to trigger the apoptotic death of a cell. The pathway starts with withdrawal of a ligand from a cell surface receptor, and ends when the execution phase of apoptosis is triggered.\")\n	(instanceOf\n		[GK_2132740]\n		[GK_2133498])\n	(name \"extrinsic apoptotic signaling pathway in absence of ligand\")\n	(referenceDatabase [GK_1]))\n\n([GK_2133501] of  GO_BiologicalProcess\n\n	(_displayName \"execution phase of apoptosis\")\n	(accession \"0097194\")\n	(componentOf [GK_2273])\n	(DB_ID 2133501)\n	(definition \"A stage of the apoptotic process that starts with the controlled breakdown of the cell through the action of effector caspases or other effector molecules (e.g. cathepsins, calpains etc.). Key steps of the execution phase are rounding-up of the cell, retraction of pseudopodes, reduction of cellular volume (pyknosis), chromatin condensation, nuclear fragmentation (karyorrhexis), plasma membrane blebbing and fragmentation of the cell into apoptotic bodies. When the execution phase is completed, the cell has died.\")\n	(hasPart [GK_264078])\n	(instanceOf [GK_3132308])\n	(name \"execution phase of apoptosis\")\n	(referenceDatabase [GK_1]))\n\n([GK_2133506] of  GO_MolecularFunction\n\n	(_displayName \"cysteine-type endopeptidase activity involved in apoptotic signaling pathway\")\n	(accession \"0097199\")\n	(componentOf [GK_2133497])\n	(DB_ID 2133506)\n	(definition \"Catalysis of the hydrolysis of internal, alpha-peptide bonds in a polypeptide chain by a mechanism in which the sulfhydryl group of a cysteine residue at the active center acts as a nucleophile, and contributing to the apoptotic signaling pathway.\")\n	(instanceOf [GK_2133460])\n	(name \"cysteine-type endopeptidase activity involved in apoptotic signaling pathway\")\n	(referenceDatabase [GK_1]))\n\n([GK_2133509] of  GO_BiologicalProcess\n\n	(_displayName \"activation of cysteine-type endopeptidase activity\")\n	(accession \"0097202\")\n	(DB_ID 2133509)\n	(definition \"Any process that initiates the activity of the inactive enzyme cysteine-type endopeptidase.\")\n	(instanceOf\n		[GK_172710]\n		[GK_1996045])\n	(name \"activation of cysteine-type endopeptidase activity\")\n	(referenceDatabase [GK_1]))\n\n([GK_2133692] of  GO_BiologicalProcess\n\n	(_displayName \"regulation of apoptotic signaling pathway\")\n	(accession \"2001233\")\n	(DB_ID 2133692)\n	(definition \"Any process that modulates the frequency, rate or extent of apoptotic signaling pathway.\")\n	(instanceOf\n		[GK_6192]\n		[GK_139812])\n	(name \"regulation of apoptotic sign