2005].<p> Prevention of RIP1 ubiquitination leads to a strong association of RIP1 and caspase-8 [Feoktistova M et al 2011, Tenev et al 2011].\"))\n\n([GK_2584545] of  Summation\n\n	(_displayName \"TLR3/4 signaling component were shown to mediate apoptosis i...\")\n	(DB_ID 2584545)\n	(text \"TLR3/4 signaling component were shown to mediate apoptosis in various human cell lines in the FADD:caspasse-8-dependent manner [Kalai M et al 2002; Kaiser WJ and Offermann MK 2005; Estornes Y et al 2012]. Caspase-8 zymogens (procaspase-8) are present in the cells as inactive monomers, containing a large N-terminal prodomain with two death effector domains (DED), and a C-terminal catalytic subunit composed of small and a large domains separated by a smaller linker region [Donepudi M et al 2003; Keller N et al 2009]. Dimerization is required for caspase-8 activation [Donepudi M et al 2003]. The dimerization event occurs at the receptor signaling complex. Once dimerized, caspase-8 zymogen undergoes a series of autoproteolytic cleavage events at aspartic acid residues in their interdomain linker regions. A second cleavage event between the the N-terminal prodomain and the catalytic domain releases the active caspase from the activation complex into the cytosol. The resulting fully active enzyme is a homodimer of catalytic domains, where each domain is compsed of a large p18 and a small p10 subunit [Keller N et al 2009; Oberst A et al 2010].\"))\n\n([GK_2584548] of  LiteratureReference\n\n	(_displayName \"Tipping the balance between necrosis and apoptosis in human and murine cells treated with interferon and dsRNA\")\n	(author\n		[GK_2584536]\n		[GK_2584569]\n		[GK_2584549]\n		[GK_2584561]\n		[GK_2584560]\n		[GK_2584567]\n		[GK_2584558])\n	(DB_ID 2584548)\n	(journal \"Cell Death Differ.\")\n	(pages \"981-94\")\n	(pubMedIdentifier 12181749)\n	(title \"Tipping the balance between necrosis and apoptosis in human and murine cells treated with interferon and dsRNA\")\n	(volume 9)\n	(year 2002))\n\n([GK_2584549] of  Person\n\n	(_displayName \"Vanden Berghe, T\")\n	(DB_ID 2584549)\n	(firstname \"T\")\n	(initial \"T\")\n	(surname \"Vanden Berghe\"))\n\n([GK_2584550] of  Person\n\n	(_displayName \"Broemer, Meike\")\n	(DB_ID 2584550)\n	(firstname \"Meike\")\n	(initial \"M\")\n	(surname \"Broemer\"))\n\n([GK_2584551] of  Person\n\n	(_displayName \"Wallberg, Fredrik\")\n	(DB_ID 2584551)\n	(firstname \"Fredrik\")\n	(initial \"F\")\n	(surname \"Wallberg\"))\n\n([GK_2584552] of  Person\n\n	(_displayName \"Wang, Xiaodong\")\n	(DB_ID 2584552)\n	(firstname \"Xiaodong\")\n	(initial \"X\")\n	(surname \"Wang\"))\n\n([GK_2584553] of  Person\n\n	(_displayName \"Zachariou, Anna\")\n	(DB_ID 2584553)\n	(firstname \"Anna\")\n	(initial \"A\")\n	(surname \"Zachariou\"))\n\n([GK_2584555] of  Person\n\n	(_displayName \"Darding, Maurice\")\n	(DB_ID 2584555)\n	(firstname \"Maurice\")\n	(initial \"M\")\n	(surname \"Darding\"))\n\n([GK_2584556] of  Person\n\n	(_displayName \"Tenev, Tencho\")\n	(DB_ID 2584556)\n	(firstname \"Tencho\")\n	(initial \"T\")\n	(surname \"Tenev\"))\n\n([GK_2584558] of  Person\n\n	(_displayName \"Vandenabeele, P\")\n	(DB_ID 2584558)\n	(firstname \"P\")\n	(initial \"P\")\n	(surname \"Vandenabeele\"))\n\n([GK_2584560] of  Person\n\n	(_displayName \"Burm, W\")\n	(DB_ID 2584560)\n	(firstname \"W\")\n	(initial \"W\")\n	(surname \"Burm\"))\n\n([GK_2584561] of  Person\n\n	(_displayName \"Meeus, A\")\n	(DB_ID 2584561)\n	(firstname \"A\")\n	(initial \"A\")\n	(surname \"Meeus\"))\n\n([GK_2584562] of  LiteratureReference\n\n	(_displayName \"The Ripoptosome, a signaling platform that assembles in response to genotoxic stress and loss of IAPs\")\n	(author\n		[GK_2584556]\n		[GK_2584563]\n		[GK_2584555]\n		[GK_2584550]\n		[GK_2562553]\n		[GK_2584551]\n		[GK_2584553]\n		[GK_2584564]\n		[GK_2562548]\n		[GK_2562560]\n		[GK_2584565])\n	(DB_ID 2584562)\n	(journal \"Mol. Cell\")\n	(pages \"432-48\")\n	(pubMedIdentifier 21737329)\n	(title \"The Ripoptosome, a signaling platfo