ve inhibitor of death receptor signaling\")\n	(author\n		[GK_3465445]\n		[GK_3465347]\n		[GK_3465420]\n		[GK_3465508])\n	(DB_ID 3465393)\n	(journal \"Mol. Cell. Biol.\")\n	(pages \"3964-73\")\n	(pubMedIdentifier 11359904)\n	(title \"NF-kappaB inducers upregulate cFLIP, a cycloheximide-sensitive inhibitor of death receptor signaling\")\n	(volume 21)\n	(year 2001))\n\n([GK_3465394] of  Person\n\n	(_displayName \"Holler, Nils\")\n	(DB_ID 3465394)\n	(firstname \"Nils\")\n	(initial \"N\")\n	(surname \"Holler\"))\n\n([GK_3465395] of  Summation\n\n	(_displayName \"The short form of cellular FLIP (FLIP(S) or c-FLIPS) has two...\")\n	(DB_ID 3465395)\n	(literatureReference\n		[GK_3465385]\n		[GK_3465368]\n		[GK_3465330]\n		[GK_3465503])\n	(text \"The short form of cellular FLIP (FLIP(S) or c-FLIPS) has two death effector domain DEDs, which can bind to FADD and caspase-8.  FLIP(S) protects the cells from apoptosis by inhibiting the processing of caspase-8 at the receptor level (Scaffidi C et al. 1999; Micheau O et al 2001)<p>FLIP(S) is a short-lived protein which is sensitive to ubiquitination and proteasomal degradation (Poukkula M et al. 2005;)  Protein kinase C (PKC)- mediated phosphorylation of FLIP(S) at Ser193 was shown to prolongs the half-lives of FLIP-S by inhibiting its polyubiquitination (Kaunisto A et al. 2009)\"))\n\n([GK_3465396] of  LiteratureReference\n\n	(_displayName \"Selective inhibition of FLICE-like inhibitory protein expression with small interfering RNA oligonucleotides is sufficient to sensitize tumor cells for TRAIL-induced apoptosis\")\n	(author\n		[GK_3465370]\n		[GK_3465507]\n		[GK_429711]\n		[GK_3465358]\n		[GK_3465486])\n	(DB_ID 3465396)\n	(journal \"Mol. Med.\")\n	(pages \"725-32\")\n	(pubMedIdentifier 12520089)\n	(title \"Selective inhibition of FLICE-like inhibitory protein expression with small interfering RNA oligonucleotides is sufficient to sensitize tumor cells for TRAIL-induced apoptosis\")\n	(volume 8)\n	(year 2002))\n\n([GK_3465397] of  LiteratureReference\n\n	(_displayName \"c-FLIPR, a new regulator of death receptor-induced apoptosis\")\n	(author\n		[GK_3465406]\n		[GK_3465475]\n		[GK_3465427]\n		[GK_3465348]\n		[GK_3465474])\n	(DB_ID 3465397)\n	(journal \"J. Biol. Chem.\")\n	(pages \"14507-13\")\n	(pubMedIdentifier 15701649)\n	(title \"c-FLIPR, a new regulator of death receptor-induced apoptosis\")\n	(volume 280)\n	(year 2005))\n\n([GK_3465398] of  Person\n\n	(_displayName \"Holler, N\")\n	(DB_ID 3465398)\n	(firstname \"N\")\n	(initial \"N\")\n	(surname \"Holler\"))\n\n([GK_3465399] of  Person\n\n	(_displayName \"Ye, H\")\n	(DB_ID 3465399)\n	(firstname \"H\")\n	(initial \"H\")\n	(surname \"Ye\"))\n\n([GK_3465400] of  Person\n\n	(_displayName \"Ohmori, Shigeru\")\n	(DB_ID 3465400)\n	(firstname \"Shigeru\")\n	(initial \"S\")\n	(surname \"Ohmori\"))\n\n([GK_3465401] of  Person\n\n	(_displayName \"Dittrich-Breiholz, Oliver\")\n	(DB_ID 3465401)\n	(firstname \"Oliver\")\n	(initial \"O\")\n	(surname \"Dittrich-Breiholz\"))\n\n([GK_3465402] of  Summation\n\n	(_displayName \"Following recruitment to the DISC, FLIP(L) forms a heterodim...\")\n	(DB_ID 3465402)\n	(literatureReference\n		[GK_1267757]\n		[GK_3465405]\n		[GK_3465422]\n		[GK_3465503]\n		[GK_3465393])\n	(text \"Following recruitment to the DISC, FLIP(L) forms a heterodimer with caspase-8 through both death effector domain (DED) and caspase-like domain (CLD). In addition, FLIP-L can also regulate TNF-R1 signaling via interaction with the DED of FADD. The regulatory function of FLIP(L) has been found to differ depending on its expression levels. c-FLIP was shown to inhibit death receptor (DR)-mediated apoptosis only when expressed at high levels, while low cell levels of FLIP(L) enhanced DR signaling to apoptosis (Boatright KM et al. 2004; Okano H et al. 2003; Yerbes R et al. 2011). The expression levels of c-FLIP proteins were shown to be regulated by NFkappaB signaling pathway (Micheau O et a. 2001; Kreuz S et al 2001).\"))\n\n([GK_3465403] of