 (DR)-mediated apoptosis only when expressed at high levels, while low cell levels of FLIP(L) enhanced DR signaling to apoptosis (Sharp DA et al. 2005; Siegmund D et al. 2002; Boatright KM et al. 2004; Okano H et al. 2003; Yerbes R et al. 2011). The expression levels of c-FLIP proteins were shown to be regulated by NFkappaB signaling pathway (Micheau O et a. 2001; Kreuz S et al 2001).\"))\n\n([GK_3465447] of  Person\n\n	(_displayName \"Stadel, Dominic\")\n	(DB_ID 3465447)\n	(firstname \"Dominic\")\n	(initial \"D\")\n	(surname \"Stadel\"))\n\n([GK_3465448] of  BlackBoxEvent\n\n	(_displayName \"[Hsa] Caspase-8 and FLIP(L) processing at DISC\")\n	(_doRelease TRUE)\n	(authored [GK_3371406])\n	(catalystActivity [GK_139951])\n	(DB_ID 3465448)\n	(edited [GK_3508822])\n	(input [GK_3371381])\n	(literatureReference\n		[GK_1267786]\n		[GK_3465386]\n		[GK_3465412]\n		[GK_1267836]\n		[GK_3465456]\n		[GK_3465334])\n	(name \"Caspase-8 and FLIP(L) processing at DISC\")\n	(output\n		[GK_3465431]\n		[GK_3465483])\n	(precedingEvent\n		[GK_3465459]\n		[GK_3371360]\n		[GK_3371359])\n	(releaseDate \"2013-06-11\")\n	(reviewed [GK_3597630])\n	(species [GK_48887])\n	(stableIdentifier [GK_3654297])\n	(summation [GK_3465328]))\n\n([GK_3465449] of  Person\n\n	(_displayName \"Irmler, M\")\n	(DB_ID 3465449)\n	(firstname \"M\")\n	(initial \"M\")\n	(surname \"Irmler\"))\n\n([GK_3465450] of  Person\n\n	(_displayName \"Sax√©n, Henrik\")\n	(DB_ID 3465450)\n	(firstname \"Henrik\")\n	(initial \"H\")\n	(surname \"Sax√©n\"))\n\n([GK_3465451] of  Person\n\n	(_displayName \"Armstrong, R C\")\n	(DB_ID 3465451)\n	(firstname \"R C\")\n	(initial \"RC\")\n	(surname \"Armstrong\"))\n\n([GK_3465452] of  Person\n\n	(_displayName \"Martinon, F\")\n	(DB_ID 3465452)\n	(firstname \"F\")\n	(initial \"F\")\n	(surname \"Martinon\"))\n\n([GK_3465453] of  Person\n\n	(_displayName \"Bullrich, F\")\n	(DB_ID 3465453)\n	(firstname \"F\")\n	(initial \"F\")\n	(surname \"Bullrich\"))\n\n([GK_3465454] of  LiteratureReference\n\n	(