\"Ozawa\"))\n\n([GK_5657693] of  LiteratureReference\n\n	(_displayName \"The solution structure of the SODD BAG domain reveals additional electrostatic interactions in the HSP70 complexes of SODD subfamily BAG domains\")\n	(author\n		[GK_5657715]\n		[GK_5657684]\n		[GK_5657717]\n		[GK_5657701]\n		[GK_5657723]\n		[GK_5657714]\n		[GK_5657712]\n		[GK_5657703])\n	(DB_ID 5657693)\n	(journal \"FEBS Lett.\")\n	(pages \"101-6\")\n	(pubMedIdentifier 14759524)\n	(title \"The solution structure of the SODD BAG domain reveals additional electrostatic interactions in the HSP70 complexes of SODD subfamily BAG domains\")\n	(volume 558)\n	(year 2004))\n\n([GK_5657694] of  Summation\n\n	(_displayName \"BAG4, also known as silencer of death domain (SODD), belongs...\")\n	(DB_ID 5657694)\n	(literatureReference\n		[GK_5657708]\n		[GK_5657695]\n		[GK_5657697]\n		[GK_5657711]\n		[GK_5657693]\n		[GK_5657681]\n		[GK_5657731]\n		[GK_5657729]\n		[GK_5657704]\n		[GK_5692356]\n		[GK_5692336])\n	(text \"BAG4, also known as silencer of death domain (SODD), belongs to the BAG family of anti-apoptotic proteins. Mammalian BAG4 was found to associate with TNFR1 preventing receptor signaling in the absence of ligand (Jiang Y et al. 1999; Miki K and Eddy EM 2002). Furthermore, crystallographic data and biochemical analysis showed that TNFR1 forms inactive homodimers or homotrimers in the absence of TNF by the N-terminal domain, the pre ligand assembly domain (PLAD) (Chan FK et al. 2000; Wang YL et al. 2011). Upon TNF-alpha binding BAG4 is quickly released from TNFR1 and three receptor molecules form a complex with the TNF trimer.<p>The TNF-alpha:TNFR1 receptor complex then transmits the signal leading to cell death or survival. However, it remains unclear whether BAG4 binds to death domain of monomeric TNFR1 to prevent receptor oligomerization or recognizes receptor trimers to facilitate ATP-dependent TNFR1 trimer disassembly (Jiang Y et al. 1999; Miki K and Eddy EM 2002). Additionally, BAG4 is known to interact with HSP70, death receptor 3, and the anti-apoptotic protein Bcl-2 (Antoku et al. 2001; Brockmann et al. 2004; Jiang et al. 1999).<p>BAG4-overexpressing HeLa cells showed reduced cellular sensitivity to treatment with extracellular TNFalpha and CD95 ligand (Eichholtz-Wirth H et al. 2003). In addition, increased expression level of BAG4 in tumor cells leads to resistance of TNFalpha-induced cell death and is associated with pancreatic cancer, some types of melanoma, acute lymphoblastic leukemia etc.(Ozawa et al. 2000; Tao H et ql. 2007; Reuland SN et al. 2013). The physiological relevance of BAG4 for TNFR1 signaling, however, is difficult to judge because BAG4 knockout mice have no or only a mild effect on pro-inflammatory TNF signaling and give no evidence for an inhibitory role of BAG4 in TNFR1-induced cell death (Takada H et al. 2003; Endres R et al. 2003).\"))\n\n([GK_5657695] of  LiteratureReference\n\n	(_displayName \"Tumor necrosis factor receptor 1 is an ATPase regulated by silencer of death domain\")\n	(author\n		[GK_3595145]\n		[GK_70446])\n	(DB_ID 5657695)\n	(journal \"Mol. Cell. Biol.\")\n	(pages \"2536-43\")\n	(pubMedIdentifier 11909948)\n	(title \"Tumor necrosis factor receptor 1 is an ATPase regulated by silencer of death domain\")\n	(volume 22)\n	(year 2002))\n\n([GK_5657696] of  Person\n\n	(_displayName \"Wolz, Lucie\")\n	(DB_ID 5657696)\n	(firstname \"Lucie\")\n	(initial \"L\")\n	(surname \"Wolz\"))\n\n([GK_5657697] of  LiteratureReference\n\n	(_displayName \"Overexpression of the \'silencer of death domain\', SODD/BAG-4, modulates both TNFR1- and CD95-dependent cell death pathways\")\n	(author\n		[GK_5657719]\n		[GK_5657732]\n		[GK_5657696])\n	(DB_ID 5657697)\n	(journal \"Cancer Lett.\")\n	(pages \"81-9\")\n	(pubMedIdentifier 12706861)\n	(title \"Overexpression of the \'silencer of death domain\', SODD/BAG-4, modulates both TNFR1- and CD95-dependent cell death pathways\")\n	(volume 194)\n	(year 2003))\n\n([GK_5657698] of  Person\n\n	(_d