r  alternativeName: Apopain  alternativeName: Cysteine protease CPP32 shortName:CPP-32  alternativeName: Protein Yama  alternativeName: SREBP cleavage activity 1 shortName:SCA-1  component recommendedName: Caspase-3 subunit p17  /component component recommendedName: Caspase-3 subunit p12  /component\")\n	(chain\n		\"propeptide:1-9\"\n		\"propeptide:10-28\"\n		\"chain:29-175\"\n		\"chain:176-277\")\n	(checksum \"2F35CD3BCF7FF64A\")\n	(comment \"CATALYTIC ACTIVITY Strict requirement for an Asp residue at positions P1 and P4. It has a preferred cleavage sequence of Asp-Xaa-Xaa-Asp-|- with a hydrophobic amino-acid residue at P2 and a hydrophilic amino-acid residue at P3, although Val or Ala are also accepted at this position.ENZYME REGULATION Inhibited by isatin sulfonamides.TISSUE SPECIFICITY Highly expressed in lung, spleen, heart, liver and kidney. Moderate levels in brain and skeletal muscle, and low in testis. Also found in many cell lines, highest expression in cells of the immune system.PTM Cleavage by granzyme B, caspase-6, caspase-8 and caspase-10 generates the two active subunits. Additional processing of the propeptides is likely due to the autocatalytic activity of the activated protease. Active heterodimers between the small subunit of caspase-7 protease and the large subunit of caspase-3 also occur and vice versa.\")\n	(DB_ID 57022)\n	(description \"recommendedName: Caspase-3 shortName:CASP-3 ecNumber3.4.22.56/ecNumber  alternativeName: Apopain  alternativeName: Cysteine protease CPP32 shortName:CPP-32  alternativeName: Protein Yama  alternativeName: SREBP cleavage activity 1 shortName:SCA-1  component recommendedName: Caspase-3 subunit p17  /component component recommendedName: Caspase-3 subunit p12  /component\")\n	(geneName\n		\"CASP3\"\n		\"CPP32\")\n	(identifier \"P42574\")\n	(isSequenceChanged FALSE)\n	(keyword\n		\"3D-structure\"\n		\"Acetylation\"\n		\"Apoptosis\"\n		\"Complete proteome\"\n		\"Cytoplasm\"\n		\"Direct protein sequencing\"\n		\"Hydro