-399) is associated with a blunted response to inhaled LPS.MISCELLANEOUS His-456 and His-458 are found in TLR4 of human and several other primate species and may be responsible for inflammatory responses triggered by nickel (Ni(2+)). Ni(2+) may cross-link the two receptor monomers through specific histidines, triggering the formation of a dimer that structurally resembles that induced by LPS. This process may be the basis for the development of contact allergy to Ni(2+). A mouse model of contact allergy to Ni(2+) in which TLR4-deficient mice expresses human TLR4 has been proposed.\")\n	(DB_ID 66107)\n	(description \"recommendedName: Toll-like receptor 4  alternativeName: hToll  cdAntigenNameCD284/cdAntigenName\")\n	(geneName \"TLR4\")\n	(identifier \"O00206\")\n	(isSequenceChanged FALSE)\n	(keyword\n		\"3D-structure\"\n		\"Age-related macular degeneration\"\n		\"Alternative splicing\"\n		\"Cell membrane\"\n		\"Complete proteome\"\n		\"Direct protein sequencing\"\n		\"Disulfide bond\"\n		\"Glycoprotein\"\n		\"Immunity\"\n		\"Inflammatory response\"\n		\"Innate immunity\"\n		\"Leucine-rich repeat\"\n		\"Membrane\"\n		\"Polymorphism\"\n		\"Receptor\"\n		\"Reference proteome\"\n		\"Repeat\"\n		\"Signal\"\n		\"Transmembrane\"\n		\"Transmembrane helix\")\n	(name \"TLR4\")\n	(referenceDatabase [GK_2])\n	(secondaryIdentifier\n		\"TLR4_HUMAN\"\n		\"A8K1Y8\"\n		\"A9XLP9\"\n		\"A9XLQ0\"\n		\"A9XLQ1\"\n		\"B4E194\"\n		\"D1CS52\"\n		\"D1CS53\"\n		\"Q5VZI8\"\n		\"Q5VZI9\"\n		\"Q9UK78\"\n		\"Q9UM57\")\n	(sequenceLength 839)\n	(species [GK_48887]))\n\n([GK_66186] of  EntityWithAccessionedSequence\n\n	(_displayName \"[Hsa] TNFSF10 [extracellular region]\")\n	(DB_ID 66186)\n	(endCoordinate 281)\n	(name\n		\"TNFSF10\"\n		\"TRAIL\"\n		\"Tumor necrosis factor ligand superfamily member 10 (TNF-related apoptosis inducing ligand) (TRAIL protein) (Apo-2 ligand) (Apo-2L)\"\n		\"Tumor necrosis factor ligand superfamily member 10\"\n		\"TNF-related apoptosis inducing ligand\"\n		\"TRAIL protei