eName: Protease nexin-II shortName:PN-II  alternativeName: Protease nexin-II shortName:PN-II  component recommendedName: N-APP  /component component recommendedName: Soluble APP-alpha shortName:S-APP-alpha  /component component recommendedName: Soluble APP-beta shortName:S-APP-beta  /component component recommendedName: C99  /component component recommendedName: Beta-amyloid protein 42  alternativeName: Beta-APP42  /component component recommendedName: Beta-amyloid protein 40  alternativeName: Beta-APP40  /component component recommendedName: C83  /component component recommendedName: P3(42)  /component component recommendedName: P3(40)  /component component recommendedName: C80  /component component recommendedName: Gamma-secretase C-terminal fragment 59  alternativeName: Amyloid intracellular domain 59 shortName:AICD-59 shortName:AID(59)  alternativeName: Gamma-CTF(59)  /component component recommendedName: Gamma-secretase C-terminal fragment 57  alternativeName: Amyloid intracellular domain 57 shortName:AICD-57 shortName:AID(57)  alternativeName: Gamma-CTF(57)  /component component recommendedName: Gamma-secretase C-terminal fragment 50  alternativeName: Amyloid intracellular domain 50 shortName:AICD-50 shortName:AID(50)  alternativeName: Gamma-CTF(50)  /component component recommendedName: C31  /component\")\n	(checksum \"1\")\n	(comment \"INDUCTION Increased levels during neuronal differentiation.PTM Proteolytically processed under normal cellular conditions. Cleavage either by alpha-secretase, beta-secretase or theta-secretase leads to generation and extracellular release of soluble APP peptides, S-APP-alpha and S-APP-beta, and the retention of corresponding membrane-anchored C-terminal fragments, C80, C83 and C99. Subsequent processing of C80 and C83 by gamma-secretase yields P3 peptides. This is the major secretory pathway and is non-amyloidogenic. Alternatively, presenilin/nicastrin-mediated gamma-secretase processing of C99 releases the amyloid beta proteins, amyloid-beta 40 (Abeta40) and amyloid-beta 42 (Abeta42), major components of amyloid plaques, and the cytotoxic C-terminal fragments, gamma-CTF(50), gamma-CTF(57) and gamma-CTF(59).PTM Extracellular binding and reduction of copper, results in a corresponding oxidation of Cys-144 and Cys-158, and the formation of a disulfide bond. In vitro, the APP-Cu(+) complex in the presence of hydrogen peroxide results in an increased production of beta-amyloid-containing peptides.PTM Beta-amyloid peptides are degraded by IDE.MISCELLANEOUS Chelation of metal ions, notably copper, iron and zinc, can induce histidine-bridging between beta-amyloid molecules resulting in beta-amyloid-metal aggregates. The affinity for copper is much higher than for other transient metals and is increased under acidic conditions. Extracellular zinc-binding increases binding of heparin to APP and inhibits collagen-binding.SIMILARITY Belongs to the APP family.SIMILARITY Contains 1 BPTI/Kunitz inhibitor domain.\")\n	(DB_ID 69781)\n	(description \"recommendedName: Amyloid beta A4 protein  alternativeName: ABPP  alternativeName: APPI shortName:APP  alternativeName: APPI shortName:APP  alternativeName: Alzheimer disease amyloid protein  alternativeName: Cerebral vascular amyloid peptide shortName:CVAP  alternativeName: Cerebral vascular amyloid peptide shortName:CVAP  alternativeName: PreA4  alternativeName: Protease nexin-II shortName:PN-II  alternativeName: Protease nexin-II shortName:PN-II  component recommendedName: N-APP  /component component recommendedName: Soluble APP-alpha shortName:S-APP-alpha  /component component recommendedName: Soluble APP-beta shortName:S-APP-beta  /component component recommendedName: C99  /component component recommendedName: Beta-amyloid protein 42  alternativeName: Beta-APP42  /component component recommendedName: Beta-amyloid protein 40  alternativeName: Beta-APP40  /component component recommendedName: C83  /component component recommendedName: P3(42)  /component co