:RIPK1 complex has been formed...\")\n	(DB_ID 74302)\n	(literatureReference [GK_140979])\n	(text \"Once the TNF-alpha:TNFR1:TRADD:RIPK1 complex has been formed there is concomitant recruitment of TRAF2:cIAP1/2 complex and then of the TAB2:TAK1 and the IKK complex. RIPK1 and the TRAF2:cIAP1/2 can be released from TNFR1 receptor complex in a poorly understood process associated with internalization and after that there is the formation of a so called complex II containing the adapter protein FADD, caspase-8 and RIPK1. Complex II has the potential to activate caspase-8 (Micheau O & Tschopp J 2003). The steps leading to the JUN, NF kappaB or apoptotic pathways are rife with opportunities for modulation.\"))\n\n([GK_74353] of  Summation\n\n	(_displayName \"Once formed in context of the TNFR1 signaling complex the TR...\")\n	(DB_ID 74353)\n	(text \"Once formed in context of the TNFR1 signaling complex the TRADD:TRAF2:RIPK1 complex may dissociate from the TNF:TNFR1 platform. With the recruitment of FADD and caspase-8 to the TRADD:TRAF2:RIPK1 complex the cell is pushed along the apoptotic pathway provided that the protective FLIP protein and TRAF2-associated BIRC (cIAPs) do not inhibit caspase-8 activation by RIPK1 and RIPK3-mediated activation of the necroptotic pathway.\"))\n\n([GK_75114] of  Complex\n\n	(_displayName \"[Hsa] FASL:FAS trimer:FADD:CASP8(1-479) [plasma membrane]\")\n	(DB_ID 75114)\n	(hasComponent\n		[GK_43124]\n		[GK_57031])\n	(literatureReference\n		[GK_3465531]\n		[GK_3465522])\n	(name \"FASL:FAS trimer:FADD:CASP8(1-479)\")\n	(species [GK_48887])\n	(stableIdentifier [GK_362769]))\n\n([GK_75146] of  Reaction\n\n	(_displayName \"[Hsa] TRAIL:TRAIL Receptor Trimer:FADD complex binds procaspase-8\")\n	(_doRelease TRUE)\n	(authored [GK_140952])\n	(DB_ID 75146)\n	(edited [GK_5633134])\n	(input\n		[GK_57031]\n		[GK_5637464])\n	(literatureReference [GK_141128])\n	(name \"TRAIL:TRAIL Receptor Trimer:FADD complex binds procaspase-8\")\n	(output [GK_5637468])\n	(prec