the accumulation and deposition of fibrillar material does not correlate well with disease pathogenesis and it is now widely believed that oligomeric amyloid forms are  largely responsible for the cytotoxic effects of amyloid (Glabe 2009). Fibrils have been described as more like crystalline polymer structures than the protein monomers they are derived from (Wetzel et al. 2007). Fibril formation is usually preceded by the association of monomers into oligomeric structures (Kodali & Wetzel 2007). For Beta-amyloid, these are spherical structures with around 12 units (Bernstein et al. 2005). Larger structures called protofibrils are also observed, non-spherical filamentous structures lacking a periodic substructure (Goldsbury 2005). \"))\n\n([GK_977112] of  Person\n\n	(_displayName \"Hansen, JB\")\n	(DB_ID 977112)\n	(initial \"JB\")\n	(surname \"Hansen\"))\n\n([GK_977113] of  Person\n\n	(_displayName \"Nettleton, EJ\")\n	(DB_ID 977113)\n	(initial \"EJ\")\n	(surname \"Nettleton\"))\n\n([GK_977114] of  Person\n\n	(_displayName \"Ngo, C\")\n	(DB_ID 977114)\n	(initial \"C\")\n	(surname \"Ngo\"))\n\n([GK_977115] of  LiteratureReference\n\n	(_displayName \"Proteoglycans in the pathogenesis of Alzheimer\'s disease and other amyloidoses\")\n	(author\n		[GK_977167]\n		[GK_977185])\n	(DB_ID 977115)\n	(journal \"Neurobiol Aging\")\n	(pages \"481-97\")\n	(pubMedIdentifier 2682326)\n	(title \"Proteoglycans in the pathogenesis of Alzheimer\'s disease and other amyloidoses\")\n	(volume 10)\n	(year 1989))\n\n([GK_977116] of  Person\n\n	(_displayName \"Bouchard, M\")\n	(DB_ID 977116)\n	(initial \"M\")\n	(surname \"Bouchard\"))\n\n([GK_977117] of  Person\n\n	(_displayName \"Hrncic, R\")\n	(DB_ID 977117)\n	(initial \"R\")\n	(surname \"Hrncic\"))\n\n([GK_977118] of  LiteratureReference\n\n	(_displayName \"Familial subepithelial corneal amyloidosis--a lactoferrin-related amyloidosis\")\n	(author\n		[GK_977080]\n		[GK_977208]\n		[GK_977134]\n		[GK_977090]\n		[GK_977201]\n		[GK_538696])\n	(D